import { BrowserRouter, Routes, Route } from "react-router-dom";
import './App.css';
import Home from './Component/Home';
import Hotel from './Component/Hotel';
// import HotelDetails from './Component/hotelDetails';
import Login from './Component/Login';
import Nav from './Component/Nav';
import Radision from './Component/Radision';
import RatingS from './Component/RatingS';
import Register from './Component/Register';
import ViewIt from './Component/ViewIt';

function App() {
  return (
   <>
<Nav/>
<Routes>

  <Route path="home" element={<Home/>} ></Route>
  <Route path="register" element={<Register/>} ></Route>
  <Route path="login" element={<Login/>} ></Route>
  {/* <Route path="register/login" element={<Login/>} ></Route> */}
  <Route path="hotel" element={<Hotel/>} ></Route>
  <Route path="radision" element={<Radision/>} ></Route>
  {/* <Route path="hotel/:hotelId" element={<HotelDetails/>} ></Route> */}
  <Route path="rate" element={<RatingS/>} ></Route> 
  <Route path="view/:_id" element={<ViewIt/>} ></Route> 


</Routes>

<BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />}>
          <Route index element={<Home />} />
          <Route path="blogs" element={<Blogs />} />
          <Route path="contact" element={<Contact />} />
          <Route path="*" element={<NoPage />} />
        </Route>
      </Routes>
    </BrowserRouter>


   </>
  );
}

export default App;
